  console.log('Umfragen');
  const [form_id, setForm_id] = useState('');
  const [form_title, setForm_title] = useState('');
  const [form_share_url, setForm_share_url] = useState('');
  useEffect(() => {
    getAllVideos();
  }, []);


  function getAllVideos() {
    const myHeaders = new Headers();
    myHeaders.append("Authorization", "Bearer eyJhbGciOiJSUzI1NiIsInR5cCI6IkpXVCIsImtpZCI6Ik1UTkJRamhFUmpZd05VRXlRakpFUkRGRk5rSXpPRGc0T0RZMlFqWTNSamd3TURoRVFUVTROZyJ9..ipPUFpT0SvWDCqbrFogEKcPaJ4gwIqjEqZg5vo2zwTCoKmGwnGrBPuy0WzeZILkRA4_0mF4OO7_1UUEqb9Thb_Ifj_QRPYlHDjdBGcwAeCCfomrjO9x0SpJBF6-YM47yRCYORVczRyAiah05XcbinTjOXCEwtECTygp5FBvRwVbiUZiAU11k-OJ8yDqFE2IMfFMmT4fEYK022rqeavmvlKR2uwZK18Z9pfONgPVoIdLmOl1NfXuLtGR53IxJmjjWLmdsyyL4x6rowcyPRdZVGGHdXTFFH7XVQWmuuX8_PPJtCfKzF_dQlRAfvumq-nEazLEOAqSui6kYHvjqBFC6Tw");

    let requestOptions = {
      method: 'GET',
      headers: myHeaders,
      redirect: 'follow'
    };

    fetch("https://api.videoask.com/forms?limit=0&offset=0&title=", requestOptions)
      .then((response) => {
        // if(response.status!==200)
        // {
        //   throw new Error(response.status)
        // }
        response.text();
      })
      .then((result) => extractVideoId(result))
      .catch((error) => console.log('error', error));
  }

  function extractVideoId(apiResult) {
